import Note from './Note';
import AddNote from './AddNote'

const NoteList = ({notes}) => {
    return <div className="notes-list">
     { notes.map(note => 
        <Note id={note.id} 
        text={note.text} 
        date={note.date}
         />)}
        <AddNote />
    </div>
}


export default NoteList;
